import "./styles/HelloWorld.css"

function HelloWorld(){
    return(
    <div className="app">
        <header>
            <div className="heading">
                <div className="introduction"><h1>Hello World!<br></br> I'm Jessica. Get to know a bit more about me.</h1></div>
            </div>
        </header>
    </div>)
}

export default HelloWorld;
